  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes activities completed
  during the past 11 months on the movement and breeding biology of bald eagles (Haliaeetus
  leucocephalus) on Adak Island, Alaska (U.S. Fish and Wildlife Service, Movement
  and Breeding Biology of Bald Eagles on Adak Island, Alaska, unpublished refuge study
  plan, Aleutian Islands Unit, Alaska Maritime National Wildlife Refuge files). The
  goals of the study are to determine basic breeding parameters of the bald eagles
  on the island, determine the nesting sites and movement of bald eagles wintering
  on the Adak Naval Station, initiate the collection of eagle longevity data, and
  investigate possible correlations between observable physical characteristics and
  sex/age differences.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
